{"post_stream":{"posts":[{"id":3031591,"name":"Sam Whitaker","username":"AstroUnit001","avatar_template":"/user_avatar/www.chiefdelphi.com/astrounit001/{size}/168109_2.png","created_at":"2022-03-28T05:47:58.625Z","cooked":"<p>Hi there, I’m from Team 3405 in Salem, Utah and our team is trying to implement PathWeaver-generated paths into our autonomous routines this year. This is my first year programming the robot and based on my current knowledge of our team’s history we have only tried to use PathWeaver once before in 2019 and didn’t experience much success. (In essence, we could run some paths but the paths were never run accurately.) I’m not sure I understand the process of “Reading in” a path JSON file yet, so I tried to follow the <a href="https://docs.wpilib.org/en/stable/docs/software/pathplanning/trajectory-tutorial/creating-following-trajectory.html" rel="noopener nofollow ugc">WPILib Trajectory Tutorial</a> using their linked example to import a JSON file. (NOTE: I was able to get the example s-curve trajectory to successfully run on our robot beforehand)</p>
<p>The code I have compiles and builds successfully, but runs into a “TrajectoryGenerationException” when I try and run the program in Autonomous mode.</p>
<p>Here’s a picture of the path I’m trying to run in case it’s needed:<br>
<div class="lightbox-wrapper"><a class="lightbox" href="https://www.chiefdelphi.com/uploads/default/original/3X/6/b/6b34d09e7721362de94a952cade08d48d050733e.png" data-download-href="https://www.chiefdelphi.com/uploads/default/6b34d09e7721362de94a952cade08d48d050733e" title="Screenshot 2022-03-27 230944"><img src="https://www.chiefdelphi.com/uploads/default/optimized/3X/6/b/6b34d09e7721362de94a952cade08d48d050733e_2_690x429.png" alt="Screenshot 2022-03-27 230944" data-base62-sha1="fiofaVrA8iN3fk3DZ8r9x4I6SDA" width="690" height="429" srcset="https://www.chiefdelphi.com/uploads/default/optimized/3X/6/b/6b34d09e7721362de94a952cade08d48d050733e_2_690x429.png, https://www.chiefdelphi.com/uploads/default/optimized/3X/6/b/6b34d09e7721362de94a952cade08d48d050733e_2_1035x643.png 1.5x, https://www.chiefdelphi.com/uploads/default/optimized/3X/6/b/6b34d09e7721362de94a952cade08d48d050733e_2_1380x858.png 2x" data-dominant-color="655F5B"><div class="meta"><svg class="fa d-icon d-icon-far-image svg-icon" aria-hidden="true"><use href="#far-image"></use></svg><span class="filename">Screenshot 2022-03-27 230944</span><span class="informations">1670×1040 990 KB</span><svg class="fa d-icon d-icon-discourse-expand svg-icon" aria-hidden="true"><use href="#discourse-expand"></use></svg></div></a></div></p>
<p>Here’s a copy of the getAutonomousCommand Command in RobotContainer.java:<br>
public Command getAutonomousCommand() {</p>
<pre><code>// Create a voltage constraint to ensure we don't accelerate too fast

var autoVoltageConstraint =

    new DifferentialDriveVoltageConstraint(

        new SimpleMotorFeedforward(

            DriveConstants.ksVolts,

            DriveConstants.kvVoltSecondsPerMeter,

            DriveConstants.kaVoltSecondsSquaredPerMeter),

        DriveConstants.kDriveKinematics,

        10);

// Create config for trajectory

TrajectoryConfig config =

    new TrajectoryConfig(

            AutoConstants.kMaxSpeedMetersPerSecond,

            AutoConstants.kMaxAccelerationMetersPerSecondSquared)

        // Add kinematics to ensure max speed is obeyed

        .setKinematics(DriveConstants.kDriveKinematics)

        // Apply the voltage constraint

        .addConstraint(autoVoltageConstraint);



// An example trajectory to follow.  All units in meters.

Trajectory exampleTrajectory =

  TrajectoryGenerator.generateTrajectory(         // THIS IS THE LINE OF CODE THROWING ERRORS

    new Pose2d(0, 0, new Rotation2d(0)),

    List.of(),

    new Pose2d(3, 0, new Rotation2d(0)),

    config);

String trajectoryJSON = "output/Jimmy.wpilib.json";

Trajectory testTrajectory = new Trajectory();



try {

  Path trajectoryPath = Filesystem.getDeployDirectory().toPath().resolve(trajectoryJSON);

  //System.out.println(trajectoryPath);

  testTrajectory = TrajectoryUtil.fromPathweaverJson(trajectoryPath);

} catch (IOException ex) {

  DriverStation.reportError("Unable to open trajectory: " + trajectoryJSON, ex.getStackTrace());

}

RamseteCommand ramseteCommand =

    new RamseteCommand(

        testTrajectory,

        m_robotDrive::getPose,

        new RamseteController(AutoConstants.kRamseteB, AutoConstants.kRamseteZeta),

        new SimpleMotorFeedforward(

            DriveConstants.ksVolts,

            DriveConstants.kvVoltSecondsPerMeter,

            DriveConstants.kaVoltSecondsSquaredPerMeter),

        DriveConstants.kDriveKinematics,

        m_robotDrive::getWheelSpeeds,

        new PIDController(DriveConstants.kPDriveVel, 0, 0),

        new PIDController(DriveConstants.kPDriveVel, 0, 0),

        // RamseteCommand passes volts to the callback

        m_robotDrive::tankDriveVolts,

        m_robotDrive);

// Reset odometry to the starting pose of the trajectory.

m_robotDrive.resetOdometry(testTrajectory.getInitialPose());

// Run path following command, then stop at the end.

return ramseteCommand.andThen(() -&gt; m_robotDrive.tankDriveVolts(0, 0));
</code></pre>
<p>}</p>
